import{_ as a,c as t,a as l,o as i}from"./app-DPjPDnzl.js";const s={};function p(r,e){return i(),t("div",null,e[0]||(e[0]=[l('<h1 id="set-和-map" tabindex="-1"><a class="header-anchor" href="#set-和-map"><span>Set 和 Map</span></a></h1><ul><li>Set Set是一种叫做集合的数据结构。特点是里面是无序且不重复（可以利用这个进行简单去重）。 里面的[value，value]结构 <ul><li>add 添加元素，返回set结构本身</li><li>delete 删除元素，返回布尔值</li><li>has 判断是否有该元素，返回一个布尔值</li><li>clear 清空</li></ul></li><li>Map Map是一种叫做字典的数据结构。里面是[key，value]结构。里面的key是不重复的。 <ul><li>size属性</li><li>set set(key,value)</li><li>get</li><li>has</li><li>delete</li><li>clear</li></ul></li></ul><h2 id="遍历map和set" tabindex="-1"><a class="header-anchor" href="#遍历map和set"><span>遍历Map和Set</span></a></h2><p>都可以使用迭代器（Iterator）来遍历Set和Map数据结构。 可以使用for of 或者 forEach(value,key)</p><h1 id="如何实现一个set" tabindex="-1"><a class="header-anchor" href="#如何实现一个set"><span>如何实现一个Set</span></a></h1><p>见 Set.js</p><h1 id="如何实现一个map" tabindex="-1"><a class="header-anchor" href="#如何实现一个map"><span>如何实现一个Map</span></a></h1><p>见 Map.js</p><h1 id="weakset-和-weakmap" tabindex="-1"><a class="header-anchor" href="#weakset-和-weakmap"><span>WeakSet 和 WeakMap</span></a></h1><ul><li>WeakSet WeakSet可以接受一个具有 Iterable接口的对象作为参数 WeakSet是一种特殊的Set，它只能存储对象类型的值，并且这些对象必须是弱引用。弱引用意味着，如果一个对象没有被其他地方引用，那么它可能会被垃圾回收机制回收。WeakSet中的对象也可能会被回收，因为WeakSet不会阻止垃圾回收机制回收WeakSet中的对象。 WeakSet没有size属性，也没有forEach、keys、values等迭代器方法。因为WeakSet中的对象可能会被回收，所以无法遍历WeakSet中的对象。 WeakSet只有add、delete和has方法。</li><li>WeakMap WeakMap是一种特殊的Map，它的键必须是对象类型的值，并且这些对象必须是弱引用。WeakMap中的键值对也可能会被回收，因为WeakMap不会阻止垃圾回收机制回收WeakMap中的键值对。 WeakMap没有size属性，也没有forEach、keys、values等迭代器方法。因为WeakMap中的键值对可能会被回收，所以无法遍历WeakMap中的键值对。 WeakMap只有set、get、delete和has方法，这些方法与Map的相应方法相似。</li></ul>',10)]))}const h=a(s,[["render",p],["__file","index.html.vue"]]),d=JSON.parse('{"path":"/interview/ES6/Map%E5%92%8CSet/","title":"Set 和 Map","lang":"zh-CN","frontmatter":{},"headers":[{"level":2,"title":"遍历Map和Set","slug":"遍历map和set","link":"#遍历map和set","children":[]}],"git":{"updatedTime":1738722167000,"contributors":[{"name":"LiHegui","username":"LiHegui","email":"1487647822@qq.com","commits":1,"url":"https://github.com/LiHegui"}]},"filePathRelative":"interview/ES6/Map和Set/index.md"}');export{h as comp,d as data};
